import React, { useState } from "react";
import { Link } from "react-router-dom";
import "../styles/Navbar.css";

const Navbar = ({ user }) => {
  const [searchQuery, setSearchQuery] = useState("");

  const handleSearchChange = (e) => {
    setSearchQuery(e.target.value);
  };

  const handleSearchSubmit = (e) => {
    e.preventDefault();
    if (searchQuery) {
      console.log("Searching for:", searchQuery);
    }
  };

  const renderLinks = () => {
    if (!user) {
      return (
        <>
          <li><Link to="/">Home</Link></li>
          <li><Link to="/login">Login</Link></li>
        </>
      );
    }

    switch (user.role) {
      case "admin":
        return (
          <>
            <li><Link to="/registration-requests">Registration Requests</Link></li>
            <li><Link to="/post-requests">Post Approval Requests</Link></li>
            <li><button className="logout-btn">Logout</button></li>
          </>
        );
      case "landlord":
        return (
          <>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/properties">Properties</Link></li>
            <li><Link to="/new-property">Upload New Property</Link></li>
            <li><Link to="/favorites">Favorites</Link></li>
            <li><Link to="/profile">My Profile</Link></li>
            <li><Link to="/contact">Contact Us</Link></li>
            <li><button className="logout-btn">Logout</button></li>
          </>
        );
      default: // general user
        return (
          <>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/properties">Properties</Link></li>
            <li><Link to="/favorites">Favorites</Link></li>
            <li><Link to="/profile">My Profile</Link></li>
            <li><Link to="/contact">Contact Us</Link></li>
            <li><button className="logout-btn">Logout</button></li>
          </>
        );
    }
  };

  return (
    <nav className="navbar">
      <div className="navbar-container">
        <div className="logo">
          <Link to="/">RentMate</Link>
        </div>

        <form className="search-form" onSubmit={handleSearchSubmit}>
          <input
            type="text"
            placeholder="Search properties..."
            value={searchQuery}
            onChange={handleSearchChange}
            className="search-input"
          />
          <button type="submit" className="search-btn">Search</button>
        </form>

        <ul className="nav-links">
          {renderLinks()}
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
